import { Col, Row } from 'antd';
import React from 'react'

function IdariDuyuru() {
  return (
    <div>
      <Row  >
        <Col span={24}>
        <img  alt='duyuruu' src='./assets/images/duyuruu.png'/>
        </Col>
      </Row>
    </div>
  )
}

export default IdariDuyuru;
